import NotificationBell from './NotificationBell';
import { Link } from 'react-router-dom';
const Navbar = () => (
  <nav style={{ padding: '1rem', background: '#1976d2', color: '#fff', display: 'flex', alignItems: 'center' }}>
    <div style={{ flex: 1 }}>
      <Link to="/" style={{ color: '#fff', marginRight: 16 }}>Home</Link>
      <Link to="/alumni" style={{ color: '#fff', marginRight: 16 }}>Alumni</Link>
      <Link to="/mentorship" style={{ color: '#fff', marginRight: 16 }}>Mentorship</Link>
      <Link to="/chat" style={{ color: '#fff', marginRight: 16 }}>Chat</Link>
      <Link to="/jobs" style={{ color: '#fff', marginRight: 16 }}>Jobs</Link>
      <Link to="/events" style={{ color: '#fff', marginRight: 16 }}>Events</Link>
      <Link to="/admin" style={{ color: '#fff', marginRight: 16 }}>Admin</Link>
    </div>
    <NotificationBell />
  </nav>
);
export default Navbar;
